double J0_d(double w[], float ws1, float ws2, float ws3);

///------------- JNA interface function -----------------///
double evaluateFcns(double individual[], int func_index) {
	double fitness = 0.0;
	switch(func_index)
	{
	case 1:
		fitness = e1(individual);
		break;
	case 2:
		fitness = e2(individual);
		break;
	case 3:
		fitness = e3(individual);
		break;
	case 10:
		fitness = e0(individual, 10);
		break;
	case 20:
		fitness = e0(individual, 20);
		break;
	case 30:
		fitness = e0(individual, 30);
		break;
	case 40:
		fitness = e0(individual, 40);
		break;
	case 50:
		fitness = e0(individual, 50);
		break;
	case 60:
		fitness = e0(individual, 60);
		break;
	case 70:
		fitness = e0(individual, 70);
		break;
	case 80:
		fitness = e0(individual, 80);
		break;
	case 90:
		fitness = e0(individual, 90);
		break;
	case 100:
		fitness = e0(individual, 100);
		break;
	case 110:
		fitness = e0(individual, 110);
		break;
	case 120:
		fitness = e0(individual, 120);
		break;
	case 130:
		fitness = e0(individual, 130);
		break;
	case 140:
		fitness = e0(individual, 140);
		break;
	case 150:
		fitness = e0(individual, 150);
		break;
	case 160:
		fitness = e0(individual, 160);
		break;
	case 170:
		fitness = e0(individual, 170);
		break;
	case 180:
		fitness = e0(individual, 180);
		break;
	case 190:
		fitness = e0(individual, 190);
		break;
	case 200:
		fitness = e0(individual, 200);
		break;
	case 900:
		fitness = e0_np_test(individual, -1);
		break;
	case 980:
		fitness = e0_np_test(individual, 80);
		break;
	case 1000:
		fitness = e0_nr_test(individual);
		break;
	case 10010:
		fitness = J0_s1(individual, false);
		break;
	case 10011:
		fitness = J0_s1(individual, true);
		break;
	case 10020:
		fitness = J0_s2(individual);
		break;
	case 10030:
		fitness = J0_s3(individual);
		break;
	case 999001:
		fitness = J0_s0(individual, 0.0f, 0.0f, 1.0f);
		break;
	case 999002:
		fitness = J0_s0(individual, 0.1f, 0.1f, 1.0f);
		break;
	case 888001:
		fitness = J0_a(individual, 0.0f, 0.0f, 1.0f);
		break;
	case 888002:
		fitness = J0_a(individual, 0.1f, 0.1f, 1.0f);
		break;
	case 777001:
		fitness = J0_d(individual, 0.0f, 0.0f, 1.0f);
		break;
	case 777002:
		fitness = J0_d(individual, 0.1f, 0.1f, 1.0f);
		break;
	default:
		break;
	}
	return fitness;
}

